import React, { Component } from "react";
import { uuid } from "uuidv4";
import { Taille, Sauces, Viandes, Extra } from "./Themenu";

class Sizetacos extends Component {
  state = {
    lesTacos: [
      {
        id: uuid(),
        htmlfor: "XXL",
        img: "./img/sizeTacos/sizeTacos.png",
        nbrViandes: "4 Viandes"
      },
      {
        id: uuid(),
        htmlfor: "XL",
        img: "./img/sizeTacos/sizeTacos.png",
        nbrViandes: "3 Viandes"
      }
    ]
  };
  render() {
    let { lesTacos } = this.state;
    return (
      <>
        <Taille lesTacos={lesTacos} />
        <Viandes />
        <Sauces />
        <Extra />
        />
      </>
    );
  }
}

export default Sizetacos;
